import React from 'react';
import { NavLink } from 'react-router-dom'
import './Navbar.css'
import logo from '../../Icons/logo.png';

export default class Navbar extends React.Component {
  constructor(props) {
        super(props);
        this.state = {
          attraction: false,
          batiments: false,
        };
    }
  toggleClass() {
        this.setState({ tab: true });
    };
  render() {
    // var classNames = require('classnames');
    // let classes = classNames('nav-item', {active: this.state.active});
    return (
      <nav class="navbar navbar-fixed-top navbar-expand-lg navbar-light bg-light">
<a class="navbar-brand" href="/pageaccueil"> <img src={logo} id="logoaccueil" alt="logo" /> </a>
<button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
  <span class="navbar-toggler-icon"></span>
</button>
<div class="collapse navbar-collapse" id="navbarNavAltMarkup">
  <div class="navbar-nav">
    <a class="nav-item nav-link active" href="/ajoutmissions"> Ajouter des missions <span class="sr-only">(current)</span></a>
    <a class="nav-item nav-link active" href="/recherchemissions">Rechercher des missions</a>
  </div>
</div>
</nav>
    );
  }
}
